import React from "react";
import "./menu.css";

function Menu({ projectItem }) {
  return (
    <div className="menu">
      {projectItem.map((item) => {
        return (
          <div className="item-container" key={item.id}>
            <div className="item-wrapper">
              <img src={item.image} alt="" />
              <h2>{item.title}</h2>
              <p>{item.description}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Menu;
